import React from 'react';
import './Work.css';
import '../../Containers/Terminal/Terminal.css'

const Work = (props) =>{
    let content = (
        <ul>
            {props.repos.map((obj) =>{
            return(<li><a href={obj.link} target="_blank" rel="noreferrer">{obj.name}</a></li>)
            })}
        </ul>);

    return(
    <div className = "main">
        <h1>This Work Page is under development</h1>
        <div className="projects">
            <h3>My Projects</h3>
            {content}
        </div>
    </div>
    );
}
export default Work;
